import React from 'react';
import { Camera, Star, Clock, MapPin, Sparkles, TrendingUp, Bike, Car, Footprints } from 'lucide-react';
import { RouteCardProps } from '../types';

const RouteCard: React.FC<RouteCardProps> = ({ route, isSelected, onSelect }) => {
  const getPhotoScoreColor = (score: number) => {
    if (score >= 90) return 'photo-score-excellent';
    if (score >= 70) return 'photo-score-good';
    return 'photo-score-fair';
  };

  const getPhotoScoreIcon = (score: number) => {
    if (score >= 90) return <Sparkles className="h-4 w-4" />;
    if (score >= 70) return <TrendingUp className="h-4 w-4" />;
    return <Camera className="h-4 w-4" />;
  };

  const getTravelModeIcon = (travelMode?: string) => {
    if (!travelMode) return <Footprints className="h-4 w-4" />;
    switch (travelMode.toLowerCase()) {
      case 'walking':
        return <Footprints className="h-4 w-4" />;
      case 'cycling':
        return <Bike className="h-4 w-4" />;
      case 'driving':
        return <Car className="h-4 w-4" />;
      default:
        return <Footprints className="h-4 w-4" />;
    }
  };

  return (
    <div
      className={`glass-card rounded-2xl p-6 cursor-pointer card-hover ${
        isSelected
          ? 'ring-2 ring-primary-500 shadow-xl scale-105'
          : 'hover:shadow-lg'
      }`}
      onClick={onSelect}
    >
      <div className="flex items-start justify-between mb-4">
        <div className="flex-1">
          <div className="flex items-center space-x-2 mb-2">
            <h3 className="text-lg font-bold text-gray-900">Scenic Route</h3>
            {route.travelMode && (
              <div className="flex items-center space-x-1 bg-blue-50 px-2 py-1 rounded-full">
                {getTravelModeIcon(route.travelMode)}
                <span className="text-xs font-medium text-blue-700">{route.travelMode}</span>
              </div>
            )}
          </div>
          <div className="flex items-center space-x-4 text-sm text-gray-600">
            <div className="flex items-center space-x-2 bg-gray-50 px-3 py-1 rounded-full">
              <MapPin className="h-4 w-4 text-primary-500" />
              <span className="font-medium">{route.distance}</span>
            </div>
            <div className="flex items-center space-x-2 bg-gray-50 px-3 py-1 rounded-full">
              <Clock className="h-4 w-4 text-primary-500" />
              <span className="font-medium">{route.duration}</span>
            </div>
          </div>
        </div>
        <div className="flex items-center space-x-2">
          <div className={`px-4 py-2 rounded-full text-sm font-bold flex items-center space-x-2 ${getPhotoScoreColor(route.photoScore)}`}>
            {getPhotoScoreIcon(route.photoScore)}
            <span>{route.photoScore}%</span>
          </div>
          {route.travelMode && (
            <div className="px-3 py-2 bg-gray-100 rounded-full text-xs font-medium text-gray-700 flex items-center space-x-1">
              {getTravelModeIcon(route.travelMode)}
              <span>{route.travelMode}</span>
            </div>
          )}
        </div>
      </div>

      {route.photoSpots.length > 0 && (
        <div className="space-y-4">
          <div className="flex items-center space-x-2 text-sm text-gray-600">
            <Camera className="h-4 w-4 text-primary-500" />
            <span className="font-medium">{route.photoSpots.length} photo spots</span>
          </div>
          <div className="space-y-3">
            {route.photoSpots.slice(0, 2).map((spot) => (
              <div key={spot.id} className="bg-white/60 backdrop-blur-sm rounded-xl p-4 border border-white/20">
                <div className="flex items-center space-x-4">
                  <div className="relative">
                    <img
                      src={spot.photoUrl}
                      alt={spot.name}
                      className="w-16 h-12 object-cover rounded-lg shadow-sm"
                    />
                    <div className="absolute -top-1 -right-1 bg-yellow-400 rounded-full p-1">
                      <Camera className="h-2 w-2 text-yellow-900" />
                    </div>
                  </div>
                  <div className="flex-1 min-w-0">
                    <p className="text-sm font-bold text-gray-900 truncate">{spot.name}</p>
                    <div className="flex items-center space-x-3 text-xs text-gray-600 mt-1">
                      <div className="flex items-center space-x-1">
                        <Star className="h-3 w-3 fill-current text-yellow-500" />
                        <span className="font-medium">{spot.rating}</span>
                      </div>
                      <span className="text-gray-400">•</span>
                      <span className="font-medium">{spot.distance}</span>
                    </div>
                  </div>
                </div>
              </div>
            ))}
            {route.photoSpots.length > 2 && (
              <div className="text-center">
                <div className="inline-flex items-center space-x-2 bg-primary-50 text-primary-700 px-4 py-2 rounded-full text-sm font-medium">
                  <Sparkles className="h-4 w-4" />
                  <span>+{route.photoSpots.length - 2} more photo spots</span>
                </div>
              </div>
            )}
          </div>
        </div>
      )}

      {isSelected && (
        <div className="mt-4 pt-4 border-t border-primary-100">
          <div className="bg-gradient-to-r from-primary-50 to-primary-100 rounded-xl p-3">
            <div className="flex items-center justify-between">
              <span className="text-sm font-medium text-primary-900">Selected Route</span>
              <div className="w-2 h-2 bg-primary-500 rounded-full animate-pulse"></div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default RouteCard;
